function ceptobox(a){var c=$("#cep");var d=$("#listaresultados");var b=$("#nomedarua");c.val(a);c.focus();d.empty();b.val("")}function getCEP(a){var c=$("#enderecocep");var e=$("#listaresultados");var b=$(".enderecolista");var d=new Framework7({material:true});e.empty();$.ajax({url:"ajax/cep/searchcep.php",type:"POST",data:"rua="+a,success:function(g){var f=0;d.showIndicator();$.each(g,function(i,j){f=f+1;var h=j.cep;var l=j.rua;var k=j.bairro;h=h.replace(/\.|\-/g,"");e.append("<li id='enderecolista_"+f+"' class='enderecolista' onclick='ceptobox(\""+h+"\")' ><a href='#'  class='close-popup'><div class='item-inner'><div class='item-title'>"+l+", "+k+", "+h+"</div></div></a></li>")});setTimeout(function(){d.hideIndicator()},1000)}})};